import React, { Component } from 'react';
import './ActicleNavStyle.css';

class ArticleNavBar extends Component {

    render() {
        return (
            <div >
                <nav className="navbar navbar-dark bg-dark" >
                    <span className="navbar-brand mb-0 h1">

                        <div className="row">
                            <div className="col-md-2" >
                                <img src={`${process.env.PUBLIC_URL}/assets/pa.png`} width="30" height="30" className="d-inline-block align-top" alt=''/>
                            </div>
                            <div className="col-md-2" >
                                <h2>P<h3>erfect Articles</h3></h2>
                            </div>
                            <div className="col-md-2" >
                            </div>
                            <div className="col-md-6"></div>
                        </div>

                        {/* <img src={`${process.env.PUBLIC_URL}/assets/pa.png`} width="30" height="30" className="d-inline-block align-top" style={{
                            marginRight: '30px'
                        }} alt=''/> */}
                        {/* <section>Perfect Articles</section> */}
                    </span>
                </nav>
            </div>
        )
    }
}

export default ArticleNavBar
